import Descripcion from "../Descripcion/Descripcion";
import { Link} from 'react-router-dom';
import Image4 from "../Image4/Image4";
export default function Formulario() {

    let lugar3 = [
        {
            titulo: 'Formulario de registro',
            texto: ' Rediseño de prototitpo de alta fidelidad de registro de datos corrigiendo problemas de usabilidad y legibilidad.',
            tiempo: 'Rediseño de plataforma',
           
        },
    ];

    return (
        <div className="container my-3">
            <div className="row">
            <h1 className="titulo2">UX/UI Design</h1>
            </div>
            <div className="row">
                <div className="col ">
                    <Image4 />
                </div>
                <div className="col-sm-6">
                    <div className="lugar3">
                        {lugar3.map((descripcion, index) => {
                            return (
                                <Descripcion
                                    key={index}
                                    titulo={descripcion.titulo}
                                    texto={descripcion.texto}
                                    tiempo={descripcion.tiempo}
                                    precio={descripcion.precio}
                                    costo={descripcion.costo}
                                >
                                </Descripcion>
                            );
                        })}


                       <div className="my-3">
                        <Link to="/Rediseño-plataforma">   <button className="btn btn-secondary"> Más informacion</button></Link>
                    </div>

                    </div>
                </div>
            </div>
        </div>

    );
}
